g.script:
var opacity1 = 0;
		var opacity2 = 0;
		var circle1 = document.getElementById("circle1");
		var circle2 = document.getElementById("circle2");
		var isFirstCity = true;
		var pos = -50;
		var pos2 = 1150;
		setInterval(moveCity, 40);
		setInterval(opacity, 50);
		function opacity()
		{ 
			if (opacity1 < 1){
				circle1.setAttribute('opacity', opacity1);
				opacity1+=0.1;
			}
			else if (opacity2 < 1){
				if (opacity1 > 1 || opacity1 == 1){
					circle2.setAttribute('opacity', opacity2); 
					opacity2+=0.08;
				}
			}
			else if (opacity2 > 1 || opacity2 == 1){
				opacity1=0;
				opacity2=0;
				circle1.setAttribute('opacity', opacity1);
				circle2.setAttribute('opacity', opacity2);

			}							
		}
		function moveCity()
		{
			if (pos % 1300 == -1250 || pos % 1300 == -1251 ){
					pos = 1150;
			}
			else if (pos2 % 1300 == -1250 || pos2 % 1300 == -1251 ){
					pos2 = 1150;
			}
			var city = document.getElementById("city");
			var trans = ' translate(' + pos  + ', -180 )';
			city.setAttribute('transform', trans);
			pos -=1;

			var city2 = document.getElementById("city2");
			var trans2 = ' translate(' + pos2  + ', -180 )';
			city2.setAttribute('transform', trans2);
			pos2 -=1;
		}
